VERSION=$(lsb_release -cs) #I figure out which Ubuntu VERSION I am using.
NUM_PROCS=$(nproc)
function add_araclar {
sudo add-apt-repository ppa:linuxmint-tr/araclar -y
}
function check_repo() {
ls -C /etc/apt/sources.list.d/ | grep -c $1 1>/dev/null
}
for i in {araclar,}
	do
	!(check_repo $i) && add_$i #This is to prevent adding existing repositories every time the script is launched.🧐️
	done
#Installing needed packages:
sudo apt install -y conky conky-all conky-manager conky-manager-extra hddtemp lm-sensors sensors-applet --install-suggests
sudo dpkg-reconfigure hddtemp
sudo sensors-detect
sudo sensors
! [ -d /etc/skel/.config/autostart ] && sudo mkdir -p /etc/skel/.config/autostart
! [ -d /etc/skel/.conky ] && sudo mkdir -p /etc/skel/.conky
! [ -d $HOME/.config/autostart ] && mkdir -p $HOME/.config/autostart
echo '[Desktop Entry]
Type=Application' > $HOME/.config/autostart/conky.desktop
sed -i "$ a Exec=\"$HOME/.conky/conky-startup.sh\"" $HOME/.config/autostart/conky.desktop
echo 'Hidden=false
NoDisplay=false
X-GNOME-Autostart-enabled=true
Name[en_IN]=Conky
