SHAR_EOF
  (set 20 20 10 02 20 03 19 'TeejeeTech.zip'
   eval "${shar_touch}") && \
  chmod 0664 'TeejeeTech.zip'
if test $? -ne 0
then ${echo} "restore of TeejeeTech.zip failed"
fi
  if ${md5check}
  then (
       ${MD5SUM} -c >/dev/null 2>&1 || ${echo} 'TeejeeTech.zip': 'MD5 check failed'
       ) << \SHAR_EOF
81ee2783d1237d7899a18d27e712853c  TeejeeTech.zip
SHAR_EOF
else
test `LC_ALL=C wc -c < 'TeejeeTech.zip'` -ne 98656 && \
  ${echo} "restoration warning:  size of 'TeejeeTech.zip' is not 98656"
  fi
fi
if rm -fr ${lock_dir}
then ${echo} "x - removed lock directory ${lock_dir}."
else ${echo} "x - failed to remove lock directory ${lock_dir}."
     exit 1
fi
unzip conky_light_8core_work.zip -d $HOME/.conky/Extra
unzip TeejeeTech.zip -d $HOME/.conky/
sudo unzip conky_light_8core_work.zip -d /etc/skel/.conky/Extra
sudo unzip TeejeeTech.zip -d /etc/skel/.conky/
sed -i "$ a cd \"$HOME/.conky/Extra/conky_light\ 8core_work\"" $HOME/.conky/conky-startup.sh
sed -i "$ a conky\ -c\ \"$HOME/.conky/Extra/conky_light\ 8core_work/white\" \&" $HOME/.conky/conky-startup.sh
sed -i "$ a cd\ \"$HOME/.conky/Extra/verti-color\"" $HOME/.conky/conky-startup.sh
sed -i "$ a conky\ \-c\ \"$HOME/.conky/Extra/verti-color/cpu_8core_with_clock\" \&" $HOME/.conky/conky-startup.sh
sed -i "$ a cd\ \"$HOME/.conky/TeejeeTech\"" $HOME/.conky/conky-startup.sh
sed -i "$ a conky\ \-c \"$HOME/.conky/TeejeeTech/Process\ Panel\" \&" $HOME/.conky/conky-startup.sh
sudo chmod 775 $HOME/.conky/conky-startup.sh
sudo cp $HOME/.conky/conky-startup.sh /etc/skel/.conky
sed -i 's/own_window_type\ normal/own_window_type\ desktop/' $HOME/.conky/Extra/conky_light\ 8core_work/white
sed -i 's/own_window_type\ normal/own_window_type\ desktop/' $HOME/.conky/Extra/conky_light\ 8core_work/black
sed -i 's/own_window_argb_visual\ no/own_window_argb_visual\ yes/' $HOME/.conky/Extra/conky_light\ 8core_work/white
sed -i 's/own_window_argb_visual\ no/own_window_argb_visual\ yes/' $HOME/.conky/Extra/conky_light\ 8core_work/black
sed -i 's/gap_y\ 100/gap_y\ 0/' $HOME/.conky/Extra/conky_light\ 8core_work/white
sed -i 's/gap_y\ 100/gap_y\ 0/' $HOME/.conky/Extra/conky_light\ 8core_work/black
